import axios from "axios";


axios.defaults.baseURL="http://localhost:8085/"

var params = new URLSearchParams();

params.append("Authorization")

axios.interceptors.request.use(function (config){
        
    return config

}, function (error){
        return Promise.reject(error)
    })
